import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 20px;
`;

const Hero = styled.section`
  min-height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
  text-align: center;
  background: linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%);
`;

const Title = styled(motion.h1)`
  font-size: 4rem;
  font-weight: 800;
  color: #2d3748;
  margin-bottom: 1rem;
  line-height: 1.2;
`;

const Subtitle = styled(motion.p)`
  font-size: 1.5rem;
  color: #4a5568;
  max-width: 600px;
  margin: 0 auto;
`;

const CampaignSection = styled.section`
  padding: 100px 0;
  background: white;
`;

const CampaignCard = styled(motion.div)`
  background: white;
  border-radius: 20px;
  padding: 40px;
  margin: 20px;
  box-shadow: 0 10px 30px rgba(0,0,0,0.1);
  transition: transform 0.3s ease;

  &:hover {
    transform: translateY(-10px);
  }
`;

const CampaignTitle = styled.h2`
  color: #2d3748;
  font-size: 2rem;
  margin-bottom: 1rem;
`;

const CampaignDescription = styled.p`
  color: #4a5568;
  font-size: 1.1rem;
  line-height: 1.6;
`;

const Button = styled(motion.button)`
  background: #4299e1;
  color: white;
  border: none;
  padding: 15px 30px;
  border-radius: 30px;
  font-size: 1.1rem;
  cursor: pointer;
  margin-top: 20px;
  transition: background 0.3s ease;

  &:hover {
    background: #3182ce;
  }
`;

function App() {
  const [ref, inView] = useInView({
    threshold: 0.1,
    triggerOnce: true
  });

  return (
    <div>
      <Hero>
        <Container>
          <Title
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
          >
            The Campaign That Campaigns for Campaigns
          </Title>
          <Subtitle
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.2 }}
          >
            Because every great campaign deserves its own campaign. Meet Anirudh Panda - your next marketing maestro at Plum.
          </Subtitle>
        </Container>
      </Hero>

      <CampaignSection ref={ref}>
        <Container>
          <CampaignCard
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.8 }}
          >
            <CampaignTitle>Why This Campaign?</CampaignTitle>
            <CampaignDescription>
              Because showing is better than telling. This campaign demonstrates my ability to create engaging, human-first marketing that resonates with audiences - exactly what Plum stands for.
            </CampaignDescription>
          </CampaignCard>

          <CampaignCard
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.2 }}
          >
            <CampaignTitle>The Heart + Tech Balance</CampaignTitle>
            <CampaignDescription>
              Just like Plum's approach to insurance, this campaign combines human touch with modern tech. Built with React, Framer Motion, and a whole lot of creativity.
            </CampaignDescription>
          </CampaignCard>

          <CampaignCard
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.4 }}
          >
            <CampaignTitle>What's Next?</CampaignTitle>
            <CampaignDescription>
              Imagine what we could create together at Plum. More campaigns that feel like care, not just communication. More moments that make people smile and feel connected.
            </CampaignDescription>
            <Button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              Let's Create Something Amazing
            </Button>
          </CampaignCard>
        </Container>
      </CampaignSection>
    </div>
  );
}

export default App;
